INSERT INTO "Storage"."TextValues" ("form", "path", "ordinal", "type", "typeStandard", "id_value", "value") VALUES (24, 'ISO 19115-2:MI_Metadata:identificationInfo:abstract', 1, 'CharacterString', 'ISO 19103', 'ISO 19115-2:MI_Metadata.1:identificationInfo.1:abstract.1', 'This dataset consists of measurements from ocean color sensors and the blending of products for ocean color sensors for several products derived from the Quasi-Analytical Algorithm including absorption, backward scattering, and absorption due to CDOM and phytoplankton, and the extracted color images. In addition to these products, sea surface temperature and chlorophyll from NASA algorithms were produced. For further information on how these products were generated, please contact Robert Arnone at the Naval Research Lab ph. (228) 688-5268. E-mail: arnone@nrlssc.navy.mil');
INSERT INTO "Storage"."TextValues" ("form", "path", "ordinal", "type", "typeStandard", "id_value", "value") VALUES (24, 'ISO 19115-2:MI_Metadata:identificationInfo:purpose', 1, 'CharacterString', 'ISO 19103', 'ISO 19115-2:MI_Metadata.1:identificationInfo.1:purpose.1', 'To supply the most recent optical products for the Gulf of Mexico for real-time monitoring.');
